// import Container from './../../node_modules/react-bootstrap/Container';
import Nav from './../../node_modules/react-bootstrap/Nav';
import Navbar from "./../../node_modules/react-bootstrap/Navbar";
import "./../style/HomeNav.css";
import "./../../node_modules/bootstrap/dist/css/bootstrap.min.css"
import {Link} from 'react-router-dom';

function HomeNav() {
    return (
        <>
            <Navbar data-bs-theme="dark" className="navbar">
                <div className='navbar-contents'>
                    <div className="navbarTitle"><Navbar.Brand href="#home"><Link to='/' style={{textDecoration: 'none', color:'#FAF5F1', fontFamily:'"Satisfy", cursive', fontSize: '20px' }}>Pizza Bruno</Link></Navbar.Brand></div>
                    <div className="navbar-links">
                        <Nav>
                        <Nav.Link><Link to="/" className='link-text'>Home</Link></Nav.Link>
                        <Nav.Link href="#features"><Link to="/menu" className='link-text'>Menu</Link></Nav.Link>
                        <Nav.Link href="#pricing"><Link to="/" className='link-text'>Login</Link></Nav.Link>
                        <Link className="link-text"><box-icon name='cart-alt' color='#f6f6f6' size='md'></box-icon></Link>
                        </Nav>
                    </div>
                </div>
            </Navbar>

        </>
    );
}

export default HomeNav
